import React, {Component} from 'react';
import {DetailWrapper, DetailContent} from './style';

class Detail extends Component{
	render() {
		return (
			<DetailWrapper>
				<h3></h3>
				<DetailContent>
				</DetailContent>
			</DetailWrapper>
		)
	}
}

export default Detail;
